import { Component } from '@angular/core';

@Component({
  selector: 'app-naukri-first',
  templateUrl: './naukri-first.component.html',
  styleUrls: ['./naukri-first.component.css']
})
export class NaukriFirstComponent {
  currentComponent: string = 'welcome'; // Initially show the welcome page

  showLogin() {
    this.currentComponent = 'login';
  }

}
